import styled from "styled-components";
import { Icon } from "../icon/Icon";

type ButtonType = {
	btnTitle: string;
	link?: string;
};

export function Button({ btnTitle, link }: ButtonType) {
	return <StyledButton onclick={link}>{btnTitle}</StyledButton>;
}

const StyledButton = styled.button`
	min-width: 60px;
	min-height: 40px;
	border: 2px solid orange;
	background-color: transparent;
`;
